import React from 'react';
import PropTypes from 'prop-types';
import Head from 'next/head';
import 'antd/dist/antd.css';

const App = ({ Component }) => {
  return (
    <>
      <Head>
        <meta charset="utf-8" />
        <title>NodeBird</title>
      </Head>
      <Component />
    </>
  )
}

// props 점검, 서비스의 안정 높히기 위해
App.propTypes = {
  Component: PropTypes.elementType.isRequired,
}

export default App;
